function About() {
  return (
    <div className="flex flex-row pt-9 items-center justify-center min-h-full text-4xl text-white">
    <h1 className="text-center row-span-2">One Sheet</h1>
    <img
      className="md:pt-8 px-12 mb-[5%] w-[90%]"
      alt="john-white-one-sheet"
      aria-label="john-white-one-sheet"
      src={oneSheet}
  />
    </div>
  );
}

